;; gorilla-repl.fileformat = 1

;; **
;;; # Function Induction, using Anglican
;;; 
;;; This worksheet performs the same task as the arithmetic function induction exercise, but using Anglican for the MCMC implementation.
;; **

;; @@
(ns arithmetic-functions-anglican
   (:require [gorilla-plot.core :as plot]
             [clojure.repl :as repl]
             [clojure.core.memoize :as memo])
   (:use [anglican core emit runtime
          [state :only [get-predicts]]]))

(def log-prob observe)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-anglican/log-prob</span>","value":"#'arithmetic-functions-anglican/log-prob"}
;; <=

;; @@
(defn safe-div [x y] (if (zero? y) 0 (/ x y)))

(def operations ['+ '- '* 'safe-div])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-anglican/operations</span>","value":"#'arithmetic-functions-anglican/operations"}
;; <=

;; @@
(def memeval (memo/lru eval))

(defdist noisy-eval 
  "noisy evaluation of quoted functions"
  [code input] [compiled-fn (memeval code)
                est (compiled-fn input)
                output-dist (normal est (* 0.05 est))]
  (sample [this] (sample output-dist))
  (observe [this value] (observe output-dist value)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#object[clojure.lang.MultiFn 0x3daa4201 &quot;clojure.lang.MultiFn@3daa4201&quot;]</span>","value":"#object[clojure.lang.MultiFn 0x3daa4201 \"clojure.lang.MultiFn@3daa4201\"]"}
;; <=

;; @@
(defm gen-operation []
  (get operations (sample (uniform-discrete 0 (count operations)))))
  

(defm gen-arithmetic-expression []
  (let [expression-type (sample (discrete [0.4 0.3 0.3]))]
    (cond (= expression-type 0) (sample (uniform-discrete 0 10))
          (= expression-type 1) 'x
          :else 
          (let [operation (gen-operation)]
            (list operation (gen-arithmetic-expression) (gen-arithmetic-expression))))))

(defm gen-function [] 
  (list 'fn ['x] (list (gen-operation) (gen-arithmetic-expression) (gen-arithmetic-expression))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-anglican/gen-function</span>","value":"#'arithmetic-functions-anglican/gen-function"}
;; <=

;; @@
(with-primitive-procedures [noisy-eval]
  (defquery induce-procedure [ins outs]
    (let [func (gen-function)]
      (loop [ins ins
             outs outs]
        (if (empty? ins)
          (predict :function func)
          (do
            (observe (noisy-eval func (first ins)) (first outs))
            (recur (rest ins) (rest outs))))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-anglican/induce-procedure</span>","value":"#'arithmetic-functions-anglican/induce-procedure"}
;; <=

;; **
;;; First, let's try a very simple function: @@f(1) = 2@@, @@f(2) = 3@@, @@f(3) = 4@@.
;;; 
;;; This should learn something resembling `(fn [x] (+ x 1))`.
;; **

;; @@
(def simple-ins [1 2 3])
(def simple-outs [2 3 4])


(time 
  (def samples-simple-fn 
    (->> (doquery :lmh induce-procedure [simple-ins simple-outs])
         (drop 5000)
         (take 5000)
         (doall))))
;; @@
;; ->
;;; &quot;Elapsed time: 5236.121305 msecs&quot;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;arithmetic-functions-anglican/samples-simple-fn</span>","value":"#'arithmetic-functions-anglican/samples-simple-fn"}
;; <=

;; @@
(defn plot-function [f]
  (let [domain (range -5. 6. 0.15)
        ef (memeval f)]
    (println f)
    (plot/list-plot (map list domain (mapv ef domain)) :joined true :x-title (str f))))


(for [func (take 10 (into #{} (map #(:function (get-predicts %)) samples-simple-fn)))]
  (do
    (plot/compose
      (plot-function func)
      (plot/list-plot (map vector simple-ins simple-outs)))))
